import React, { Component } from "react";

// Stateless Functional Component
/* Note how we are passing in props as an argument, so that in span we can call on it. 
Unlike a class extending a component, we can't use this.props here */

const NavBar = (props) => {
  return (
    <nav className="navbar navbar-light bg-light">
      <a className="navbar-brand" href="#">
        Navbar{" "}
        <span className="badge badge-pill badge-secondary">
          {props.totalCounters}
        </span>
      </a>
    </nav>
  );
};

export default NavBar;
